using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using Api_savino_Filmes.Models;
using Microsoft.AspNetCore.Mvc;

// For more information on enabling MVC for empty projects, visit https://go.microsoft.com/fwlink/?LinkID=397860

namespace Api_savino_Filmes.Controllers
{
    [ApiController]
    [Route("/api/actors/")]
    public class ActorsController : ControllerBase
    { 
         private static List<ActorModel> listaAtores = new List<ActorModel>();

        [AcceptVerbs("GET")]
        [Route("ConsultarAtorPorCodigo/{codigo}")]
        public ActorModel ConsultarUsuarioPorCodigo(int codigo)
        {
            ActorModel ator = listaAtores.Where(n => n.Id == codigo)
            .Select(n => n)
            .FirstOrDefault();
            return ator;
        }
        [AcceptVerbs("GET")]
        [Route("ConsultarAtores")]
        public List<ActorModel> ConsultarAtores()
        {
            CarregarAtores();
            return listaAtores;
        }
        private void CarregarAtores()
        {
            listaAtores.Clear();
            listaAtores.Add(new ActorModel(1, "Johnny Depp", "data:image/jpeg;base64,"));
            listaAtores.Add(new ActorModel(2, "Emma Stone", "data:image/jpeg;base64,"));
            listaAtores.Add(new ActorModel(3, "Brad Pitt", "data:image/jpeg;base64,"));
            listaAtores.Add(new ActorModel(4, "Margot Robbie", "data:image/jpeg;base64,"));
            listaAtores.Add(new ActorModel(5, "Adam Sandler", "data:image/jpeg;base64,"));

        }
    }
}
